import { 
    SIGN_IN, 
    SIGN_OUT,
    SIGN_IN_ADMIN
} from './types';

export const signIn = (userId, isAdmin) => {
    return {
        type: SIGN_IN,
        payload: userId
    };
};

export const signOut = () => {
    return {
        type: SIGN_OUT
    };
};
